const INITIAL_STATE = {
	usuarios: []
};
//aca usuarios se conecta al reducer
export default (state = INITIAL_STATE, action) => {
    switch (action.type)  {
        case 'traer_usuarios':
            return { ...state, usuarios: action.payload}

            default: return state;
    }
}
